import react from "React"

function App(){
   document.getElementById("btn").addEventListener("click",getPost);
    var con=0;
    var div=document.getElementById("carDiv");
    function getPost(){
        fetch("https://jsonplaceholder.typicode.com/posts")
        .then((res)=>{
            return res.json();
        })
        .then((post)=>{
            for(let index=0; index<1; index++){
                div.innerHTML+=`
                <span>${post[con].userId}</span>
                <span>${post[con].id}</span>
                <span>${post[con].title}</span>
                <span>${post[con].body}</span>
                `
                con=con+1
            }
        })
        .catch((error)=>{
            console.log(error)
        })
    }
    return(
        <div class="container">
        <br/>
        <button id="btn">post</button>
        <div id="carDiv"></div>
    </div>
    
    )
}
export default App;














